import React, { useState } from 'react';
import ApiService from '../../services/api';
import { useSubdomain } from '../../hooks/useSubdomain';
import PropertyPortalHeader from './PropertyPortalHeader';
import PropertyDetails from './PropertyDetails';
import TenantLoginForm from './TenantLoginForm';
import InquiryForm from './InquiryForm';
import TenantDashboard from './TenantDashboard';

const PropertyPortal = () => {
    const { subdomain, isPropertyPortal, property, loading } = useSubdomain();
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [currentUser, setCurrentUser] = useState(null);
    const [accessToken, setAccessToken] = useState(localStorage.getItem('portal_access_token'));

    // Check if already logged in
    React.useEffect(() => {
        if (accessToken) {
            // Validate token and get user info
            validateToken();
        }
    }, [accessToken]);

    const validateToken = async () => {
        try {
      const data = await ApiService.portalTenantDashboard(accessToken);
      if (data && data.tenant) {
        setCurrentUser(data.tenant);
        setIsLoggedIn(true);
      } else {
        localStorage.removeItem('portal_access_token');
        setAccessToken(null);
      }
        } catch (error) {
            console.error('Token validation error:', error);
            localStorage.removeItem('portal_access_token');
            setAccessToken(null);
        }
    };

    const handleLoginSuccess = (loginData) => {
        setCurrentUser(loginData.user);
        setIsLoggedIn(true);
        setAccessToken(loginData.access_token);
        localStorage.setItem('portal_access_token', loginData.access_token);
        localStorage.setItem('portal_refresh_token', loginData.refresh_token);
    };

    const handleLogout = () => {
        setCurrentUser(null);
        setIsLoggedIn(false);
        setAccessToken(null);
        localStorage.removeItem('portal_access_token');
        localStorage.removeItem('portal_refresh_token');
    };

    if (!isPropertyPortal) {
        return (
            <div className="min-h-screen bg-red-50 flex items-center justify-center">
                <div className="text-center">
                    <h1 className="text-4xl font-bold text-red-600 mb-4">Invalid Portal</h1>
                    <p className="text-gray-600">This is not a valid property portal URL.</p>
                    <p className="text-sm text-gray-500 mt-2">
                        Please visit a property-specific subdomain like: 
                        <br />
                        <code className="bg-gray-100 px-2 py-1 rounded">modern-2br-itpark.localhost:3000</code>
                    </p>
                </div>
            </div>
        );
    }

    if (loading) {
        return (
            <div className="min-h-screen bg-gray-50 flex items-center justify-center">
                <div className="text-center">
                    <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto mb-4"></div>
                    <p className="text-gray-600">Loading property portal...</p>
                </div>
            </div>
        );
    }

    if (!property) {
        return (
            <div className="min-h-screen bg-red-50 flex items-center justify-center">
                <div className="text-center">
                    <h1 className="text-4xl font-bold text-red-600 mb-4">Property Not Found</h1>
                    <p className="text-gray-600">No property found for subdomain: <strong>{subdomain}</strong></p>
                    <p className="text-sm text-gray-500 mt-2">
                        Please check the URL or contact the property manager.
                    </p>
                </div>
            </div>
        );
    }

    return (
        <div className="min-h-screen bg-gray-50">
            <PropertyPortalHeader 
                property={property} 
                subdomain={subdomain}
                currentUser={currentUser}
                onLogout={handleLogout}
            />
            
            <main className="container mx-auto px-4 py-6 max-w-6xl">
                {isLoggedIn ? (
                    <TenantDashboard 
                        property={property}
                        currentUser={currentUser}
                        accessToken={accessToken}
                    />
                ) : (
                    <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
                        <div className="space-y-6">
                            <PropertyDetails property={property} subdomain={subdomain} />
                        </div>
                        
                        <div className="space-y-6">
                            <TenantLoginForm 
                                property={property}
                                onLoginSuccess={handleLoginSuccess}
                            />
                            
                            <div className="border-t pt-6">
                                <InquiryForm property={property} />
                            </div>
                        </div>
                    </div>
                )}
            </main>
        </div>
    );
};

export default PropertyPortal;
